import React from "react";
import { Link } from 'react-router-dom';
import "../css/ToolBar.css";
import home from "../assets/home.svg";
import newpost from "../assets/NewPost.svg";
import search from "../assets/search.svg";
import notif from "../assets/notificon.svg";
import ProfilePic from '../assets/LOKE.PNG';

function ToolBar(){
    return(
        <>
            <div className="Tools">
                <Link to='/home'><button><img id="icon" src={home}></img></button></Link>
                <Link to='/search'><button><img id="icon" src={search}></img></button></Link>
                <Link to='/newpost'><button className="upload"><img id="icon" src={newpost}></img></button></Link>
                <Link to='/notifications'><button ><img id="icon" src={notif}></img></button></Link>
                <Link to='/profile'><button ><img src={ProfilePic} id='profile'></img></button></Link>
            </div>
        </>
    )
}

export default ToolBar;
